const UserData = ({users}) => {

    const handleRowClick = (assetClass) => {
        const isExpanded = expandedRows.includes(assetClass);
        setExpandedRows(prevRows => isExpanded ? prevRows.filter(row => row !== assetClass) : [...prevRows, assetClass]);
      };

    return (
        <>
            {
                users.map((curUser,index) => {
                    const {name, ticker, avg_price,market_price,market_value_ccy,latest_chg_pct} = curUser;

                    return (
                        <tr key={index}  onClick={() => handleRowClick(holding.asset_class)}>

                            <td>{name}</td>
                            <td>{ticker}</td>
                            <td>{avg_price}</td>
                            <td>{market_price}</td>
                            <td>{market_value_ccy}</td>
                            <td>{latest_chg_pct}</td>
                        </tr>
                    )
                })

            }
        </>
    )
}
export default UserData;
